const jsonScenarios = {
    "scenarios": [
        "win in a fight to the death?",
        "make a better senator for the Galactic Senate?",
        "win in a lightsaber duel?",
        "make a better nerf-herder?",
        "make a better pilot?"
    ]
};

export default jsonScenarios;
